import React, { Component } from 'react';
import reactImage from '../images/react-logo.svg';

export class main extends Component {
  render() {
    return (
      <div>
        <img src={reactImage} alt='reactImage' style={{height:'100px', width:'100px'}}/>
      </div>
    )
  }
}

export default main;
